import React from 'react';
import DashboardV from './src/Dashboard';
import HeaderV from './src/Header';
import LineChartV from './src/LineChart';
import RadarChartV from './src/RadarChart';

function App() {
  return (
    <div style={{backgroundColor:'#eee'}}>
      <HeaderV/>
      <div style={{display:'flex'}} >
        <div >
        <DashboardV/>
        </div>

        <div style={{display:'flex'}}>

      <div style={{width:'600px',backgroundColor:'white',margin:'20px',position:'relative'}}>
      <LineChartV/>
      </div>

     <div style={{width:'600px',backgroundColor:'white',margin:'20px',position:'relative'}}>
       <RadarChartV/>
     </div>


      <div style={{width:'600px',backgroundColor:'white',margin:'20px',position:'relative'}}>
      <LineChartV/>
      </div>

      <div style={{width:'600px',backgroundColor:'white',margin:'20px',position:'relative'}}>
      <LineChartV/>
      </div>

      </div>

    </div>

</div>


  );
}

export default App;
